B.Gv=s(["Sean como el sol. Si lo hacen, disipar\xe1n la penumbra a su alrededor. Pase lo que pase, vivan con la convicci\xf3n y la seguridad de que ustedes son un sol en s\xed mismos Por supuesto, en la vida hay d\xedas de sol y d\xedas nublados. Pero el sol sigue brillando siempre, incluso detr\xe1s de las nubes. Aunque est\xe9n sufriendo, es vital que siempre mantengan despejado el sol de su coraz\xf3n.","La realidad es rigurosa\u2026 Por favor, sigan luchando contra las dificultades que se les presenten y, en cada caso, triunfen, y vuelvan a triunfar, una y otra vez: en la vida diaria, en el trabajo, en los estudios y en las relaciones familiares. Las ense\xf1anzas del budismo y nuestra pr\xe1ctica de la fe son la fuerza motriz de un desarrollo ilimitado.","Los que creen en el Sutra del loto parecen vivir en invierno, pero el invierno siempre se convierte en primavera. Ni una sola vez, desde la Antig\xfcedad, alguien ha visto u o\xeddo que el invierno se convierta en oto\xf1o. Tampoco hemos sabido de ning\xfan creyente en el Sutra del loto que contin\xfae siendo una persona com\xfan.","Nichiren Daishonin escribe: \xabSi uno enciende un farol para dar luz a otros, tambi\xe9n alumbra su propio camino\xbb. En una sociedad en proceso de envejecimiento, la postura de contribuir al bienestar de los dem\xe1s es muy importante. En definitiva, significa tambi\xe9n iluminar la propia vida. La persona capaz de decir \xabgracias\xbb de manera sincera tiene un esp\xedritu sano y vital; cada vez que lo decimos, nuestro coraz\xf3n resplandece y nuestra vitalidad se eleva poderosamente.","Los problemas, son problemas precisamente porque dudamos de nuestra capacidad para superarlos. Pero cuando enfrentamos desaf\xedos con convicci\xf3n en la fe, en el potencial ilimitado de nuestra naturaleza de Buda innata, cambiamos nuestro estado de vida y transformamos nuestra forma de responder ante ellos. De esta confianza surge la sabidur\xeda para percibir claramente nuestras circunstancias. De esta manera, es posible transformar los problemas y reorientarlos hacia la felicidad; convertir la desdicha en alegr\xeda; la angustia en esperanza, y las preocupaciones en serenidad interior.","\xabGracias\xbb es una expresi\xf3n milagrosa. Nos sentimos revitalizados al decirla, y alentados al escucharla. Cuando decimos o escuchamos esa palabra, nos despojamos de la coraza que cubre nuestro coraz\xf3n y podemos comunicarnos en el nivel m\xe1s profundo. \xabGracias\xbb es la ra\xedz de la no violencia. Contiene respeto hacia el otro, humildad y una profunda afirmaci\xf3n de la vida","Cuando el sol se eleva, ilumina todo lo que existe sobre la tierra. Cuando, de noche, se enciende un faro, puede guiar a puerto seguro a numerosos barcos. Y cuando en una familia alguien es un firme pilar, todos los integrantes pueden estar a buen resguardo y tranquilos.Les pido que vivan siempre con actitud positiva y alegre, acogiendo a quienes los rodean con coraz\xf3n abierto, amplio y humano.","No hay una sola oraci\xf3n al Gohonzon que quede sin respuesta. La Ley M\xedstica es una gran ense\xf1anza, que nos permite convertir el veneno en remedio. Mediante la fe, podemos transformar todos los sufrimientos en algo positivo y ben\xe9fico, y cultivar un estado de vida m\xe1s elevado.","Los que posean el coraz\xf3n de un le\xf3n rey sin falta manifestar\xe1n la budeidad. As\xed que \xa1pong\xe1monos de pie y clamemos con la bravura del le\xf3n! As\xed es la ense\xf1anza del Daishonin. Sigamos esforz\xe1ndonos por superar todos los obst\xe1culos y triunfar con el coraz\xf3n invencible de un rey le\xf3n."],t.s)
